import React from "react";
import posed from 'react-pose';
import SplitText from 'react-pose-text';

export default () => {

  const charPoses = {
    exit: { x: 0, opacity: 10000 },
    enter: {
      x: -100,
      opacity: 5,
      transition: ({ wordIndex }) => ({
        type: 'tween',
        delay: 1000,
      })
    }
  };
  const charPoses2 = {
    exit: { x: 0, opacity: 10000 },
    enter: {
      x: 100,
      opacity: 5,
      transition: ({ wordIndex }) => ({
        type: 'tween',
        delay: 1000,
      })
    }
  };
  return (
    <div className="component first-component">
      <SplitText
        initialPose="exit"
        pose="enter"
        charPoses={charPoses}
        style={{ color: '#cfff3c', fontWeight: '800', }}>
        <h1>Social</h1>
      </SplitText>
      <SplitText
        initialPose="exit"
        pose="enter"
        charPoses={charPoses}
        style={{ color: '#cfff3c', fontWeight: '800', }}>
        <h1>Distancing</h1>
      </SplitText>
      {/* <h1 style={{ color: '#cfff3c', fontWeight: '800', }}>SOCIAL DISTANCING</h1> */}
    </div>
  );
};
